import React, { Component } from 'react';

import { render } from 'react-dom';

import Header from './components/Header';

import './style.css';

import img from './messi.jpg'

import Information from './components/Information';

import Education from './components/Education';

import Experience from './components/Experience';

import Extras from './components/Extras';

class App extends Component {

    constructor() {

        super();

        this.state = {

            name: 'Ali Bin Arshad',

            picture: img,

            address: "Comsats, Islamabad",

            contact: [

                "ali.b.arshadd@gmail.com",

                "+923181516869"

            ],

            educations: [

                {

                    institute: "CUI",

                    degree: "CS",

                    startDate: "Sep 2017",

                    endDate: "June 2021",

                    desc: "this is just some placeholder text."

                },

                {

                    institute: "yy",

                    degree: "ashvcdx",

                    startDate: "20, Nov 2020",

                    endDate: "20, Nov 2020",

                    desc: "j gfjhfg fjg dfjg kjhg"

                }

            ],

            experiences: [

                {

                    companyName: "xx",

                    startDate: "20, dec 2020",

                    endDate: "20, Dec 2020",

                    resp: "j gfjhfg fjg dfjg kjhg"

                },

                {

                    companyName: "yy",

                    startDate: "20, Nov 2020",

                    endDate: "20, Nov 2020",

                    resp: "j gfjhfg fjg dfjg kjhg"

                }

            ],

            skills:[

                "java", "c++", "testing"

            ],

            hobbies:[

                "football", "reading"

            ]

        };

    }

    render() {

        return (

            <div>

            <Header name={this.state.name} picture={this.state.picture} />

        <Information address={this.state.address} contact={this.state.contact} />

        <Education educations={this.state.educations} />

        <Experience experiences={this.state.experiences} />

        <Extras title="Skills" dataSet={this.state.skills} />

        <Extras title="Hobbies" dataSet={this.state.hobbies} />

        </div>

    );

    }

}

render(<App />, document.getElementById('root'));
